import React from 'react';
import ChartBar from './ChartBar';
import './Chart.css'

function Chart(props) {
    return (
        <div className='chart'> 
            {props.dataPoints.map((dataPoint) => (
                <ChartBar 
                    value= {dataPoint.value}
                    key = {dataPoint.label}
                    maxValue = {null}
                    label = {dataPoint}
                />
            ))}
        </div>
    );
}

export default Chart;
